    <style>
        /* CSS para la apariencia y el centrado */
        body {
            /* Fondo azul */
            background-color: #007bff;
            
            /* Ocupar toda la ventana */
            margin: 0;
            padding: 0;
            height: 100vh;
            width: 100vw;
            
            /* Centrar el contenido */
            display: flex;
            justify-content: center; /* Centrado horizontal */
            align-items: center; /* Centrado vertical */
        }

        .contenedor-svg {
            /* Define un tamaño máximo, ya que el SVG no tiene unidades de tamaño en este caso */
            max-width: 95%; 
            max-height: 95vh;
            
            /* Aplica bordes redondeados y sombra al contenedor, lo que ayuda a que se vea bien */
            border-radius: 20px; 
            box-shadow: 0 8px 16px rgba(0, 0, 0, 0.3);
            overflow: hidden; 
            display: block; 
        }

        /* Estilo para el elemento SVG insertado */
        .contenedor-svg svg {
            display: block;
            width: 100%;
            height: 100%;
            /* Esto es importante si el SVG interno ya tiene bordes redondeados */
        }
    </style>
